# coding=utf-8
import base64

# 无论是单一base64循环解密还是base16、base32、base64混合解密都可以解出来
def getFlag(s):
    while '{' not in s:
        try:
            s = base64.b16decode(s)
        except Exception as e:
            try:
                s = base64.b32decode(s)
            except Exception as e:
                try:
                    s = base64.b64decode(s)
                except Exception as e:
                    print(e)
        finally:
            s = str(s, encoding="utf8")
    return s


if __name__ == "__main__":
    s = ''
    print(getFlag(s))
